import React from 'react';

class AdvertisingArea extends React.Component {
	render(){
		return (
			<div className="advertising-area">
				<p>adv <span>area</span></p>
				<p>470 x 100</p>
			</div>
		)
	}
}

export default AdvertisingArea;
